import React from 'react';
import '../styles/leagues.css';






function Leagues() {
    fetch('leagues.json')
            .then(response => response.json())
            .then(data => {
                const standings = data['Premier League'].standings;
                const tableBody = document.querySelector('#standingsTable tbody');

                for (const team in standings) {
                    const row = document.createElement('tr');
                    row.innerHTML = `
                        <td>${standings[team].position}</td>
                        <td>${team.replace(/-/g, ' ')}</td>
                        <td><img src="${standings[team].team_crest}" alt="${team}"></td>
                        <td>${standings[team].points}</td>
                        <td>${standings[team].games_won}</td>
                        <td>${standings[team].games_lost}</td>
                        <td>${standings[team].goals_for}</td>
                        <td>${standings[team].goals_against}</td>
                        <td>${standings[team].goal_difference}</td>
                    `;
                    tableBody.appendChild(row);
                }
            })
            .catch(error => console.error('Error fetching data:', error));

  return (


      <footer>
